BEGIN TRANSACTION;
CREATE TABLE `Downloads` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `target` VARCHAR(255) NOT NULL, `ip` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Logs` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `baseUrl` VARCHAR(255) NOT NULL, `method` VARCHAR(255) NOT NULL, `originalUrl` VARCHAR(255) NOT NULL, `query` VARCHAR(255) NOT NULL, `params` VARCHAR(255) NOT NULL, `ip` VARCHAR(255) NOT NULL, `tag` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Actions` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `ip` VARCHAR(255) NOT NULL, `tag` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
DELETE FROM sqlite_sequence;
COMMIT;
